import React from 'react'

const AccountSummary = () => {
    return (
        <div className="Account-Section">

             <div className="Account-Section-Income">
                <h3>INCOME</h3> 
                <p>$50.00</p>  
             </div>


             <div className="Account-Section-Expense">
                <h3>EXPENSE</h3> 
                <p>$10.00</p>  
             </div>

        </div>
    )
}


export  default AccountSummary;
